;; **
;;; ## smoothing the picture using a bilateral filter
;; **

;; @@
(def factor 4)
(def output (new-mat))
(def work (clone img))

(dotimes [_ factor] (pyr-down! work))
(bilateral-filter work output 9 9 7)
(dotimes [_ factor] (pyr-up! output))

(u/mat-view output)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"352\" height=\"352\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1a5a0e9a \"BufferedImage@1a5a0e9a: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 352 height = 352 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## detect and enhance edges
;;; 
;;; - Reduce noise using a median filter
;;; - Create an edge mask using adaptive thresholding
;; **

;; @@

(def edge
  (-> img
    clone
    (resize! (new-size (.cols output) (.rows output)))
    (cvt-color! COLOR_RGB2GRAY)
    (median-blur! 7)
    (adaptive-threshold! 255 ADAPTIVE_THRESH_MEAN_C THRESH_BINARY 9 7)
    (cvt-color! COLOR_GRAY2RGB)))
(u/mat-view edge)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"352\" height=\"352\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6b2dd3c6 \"BufferedImage@6b2dd3c6: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 352 height = 352 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## Combine color image with edge mask
;; **

;; @@
(let [result (new-mat) ]
  (bitwise-and output edge result)
  (u/mat-view result))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"352\" height=\"352\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x4f0c39d2 \"BufferedImage@4f0c39d2: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 352 height = 352 #numDataElements 3 dataOff[0] = 2\"]"}
